  \"Dissolved inorganic carbon, total alkalinity, temperature, salinity and other
  variables collected via time series monitoring from BOSEI MARU NO. 2, HAKUREI MARU
  and others in the North Pacific Ocean from 1992-06-23 to 2008-10-31 (NODC Accession
  0100219)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-02-26T22:14:44.664383\",\n\t\"name\":
  \"dissolved-inorganic-carbon-total-alkalinity-temperature-salinity-and-other-variables-colle\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0100219 includes chemical,
  discrete bottle, physical and time series data collected from BOSEI MARU NO. 2,
  HAKUREI MARU, Hakuho Maru, Hokusei Maru, KAIYO-MARU, MIRAI, NATSUSHIMA and OSHORO
  MARU in the North Pacific Ocean and South Pacific Ocean from 1992-06-23 to 2008-10-31
  and retrieved during cruise Time Series KNOT. These data include ALKALINITY - TOTAL,
  AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, NITRATE, NITRITE, PHOSPHATE,
  SALINITY, SIGMA-THETA, SILICATE and TEMPERATURE. The instruments used to collect
  these data include bottle. These data were collected by Akihiko Murata of Japan
  Agency for Marine-Earth Science and Technology (JAMSTEC) and Shuichi Wantanabe,
  Makio Honda and Masahide Wakita of Japan Agency for Marine-Earth Science and Technology
  (JAMSTEC); Mutsu Institute for Oceanography; Ocean Observation and Research Department
  as part of the Time_Series_KNOT data set.\",\n\t\"license_title\": \"License Not
